import logo from "./logo.svg";
import "./style.scss";

//component import
import Header from "./Components/Header";
import Footer from "./Components/Footer";
import ProductCard from "./Components/ProductCard";

//data import
import data from "./data.js";

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        {data.products.map((index, card) => {
          <ProductCard index={index} />;
        })}
        {/* <ProductCard /> */}
        <div class="row center">
          <div class="card">
            <a href="product.html">
              <img
                class="medium"
                src="./images/product-1.jpg"
                alt="product-pants"
              />
            </a>
            <div class="card-body">
              <a href="product.html">
                <h2>Jean Jacket</h2>
              </a>
              <div class="rating">
                <span>
                  <i class="fa fa-star"></i>
                </span>
                <span>
                  <i class="fa fa-star"></i>
                </span>
                <span>
                  <i class="fa fa-star"></i>
                </span>
                <span>
                  <i class="fa fa-star"></i>
                </span>
                <span>
                  <i class="fa fa-star"></i>
                </span>
              </div>
              <div class="price">$120</div>
            </div>
          </div>
        </div>
      </main>
      <Footer />
    </div>
  );
}

export default App;
